Welcome
First of all, Thank you so much for purchasing this template and for being our loyal customer. You are awesome! You are entitled to get free lifetime updates to this product and support from the css ninja team directly.
This documentation has been written to help you regarding each step of customization. Please go through the documentation carefully to understand how this template is made and how to edit this properly. HTML and CSS knowledge is required to customize this template.
! Be careful before you start working with the template and read the documentation. If not edited properly, layouts may break completely. No support is provided for faulty customization.
Bulkit 4.1 Update
You are currently reading the new Bulkit 4.1 documentation (The v3 documentation is still available at the top of the page, by clicking on the V3 DOCS link in the top right corner). Bulkit supports npm and gulp. New features have been added :

Updated Bulma to 0.9.1
Fixed various layout issues
Refactored all kits
Merged all kits into one
Added new landing pages and utilities
Added 10 built in color schemes
Redesigned and refreshed all graphic assets
Made all sections / hero / UI elements global

! Please carefully read this documentation to  get started fast with the template. You don't need to know any nodejs or anything else. Just follow the steps to setup your templates. Please also consider that with the upgrade to Bulma 0.9.1, to gulp 4 and to nodejs 10.15.3 qre breqking changes. Integrate them carefully in your ongoing work.
Getting started
Support
If you have any trouble while editing this template or if you simply want to ask a question about something, feel free to contact us at support@cssninja.io or to post your request on our support forums at cssninja.io
Prerequisites
You will need the following tools to customize this template.

A good code editor of your choice
A supported web browser
node.js and npm installed on your machine
Intermediate html knowledge
Intermediate scss knowledge
Basic javascript knowledge

! Be careful before you start working with the template and read the documentation. If not edited properly, layouts may break completely. No support is provided for faulty customization.
Template folders
You will find 3 root folders inside your Bulkit Downloaded Zip file :

documentation : The local documentation version shipped with Bulkit
bulkit-4.1.0 : The project folder containing the project
precompiled : A precompiled version (CSS, Html, Js) of the project.

! Note that the precompiled versions result from the build of the project. This documentation mostly focuses on building it using Gulp.
The Bulkit Gulp
Using this Bulkit bundle will give you total control over the template. All the important tasks are fully automated, you don't have to do anything. However, we will explain in details how to get the most from the template, even if you've never worked, with npm, gulp or panini before.
To avoid repeating same chunks of code, Bulkit gulp also uses zurb-panini, a very lightweight html templating engine. You can quikly create easily reusable chunks of code. But before diving into the template itself, We need to setup a nodejs environment. If you already have Node and Npm installed on your machine, you can skip the following sections.
Npm
To start working with Bulkit, we are going to need the Node Package Manager, commonly known as npm. npm makes it easy for JavaScript developers to share and reuse code, and makes it easy to update the code that you’re sharing, so you can build amazing things.
Install nodejs
npm is distributed with Node.js, which means that when you download Node.js, you automatically get npm installed on your computer. First, check if you already have node and npm installed. To check if you have Node.js installed, run this command in your terminal:
node -v
To confirm that you have npm installed you can run this command in your terminal:
npm -v
If node is not installed on your machine, follow the steps described in one of the following guides, depending on your operating system:

Install node.js and npm on Windows
Install node.js and npm on Linux
Install node.js and npm on Mac OSX

npm versions
npm is a separate project from Node.js, and tends to update more frequently. As a result, even if you’ve just downloaded Node.js (and therefore npm), you’ll probably need to update your npm. Luckily, npm knows how to update itself! To update your npm, type this into your terminal:
npm install npm@latest -g
Installing gulp.js
Gulp is a "Task runner" served as a Frontend tool. It is capable of executing chunks of code and save you huge amounts of time. What gulp can do is very vast :

Simple operations like CSS and Javascript minification / concatenation
Directory creation or deletion, project creation from scratch
Image optimization and compression
Deploying a local server to run tests
Ghost browser simulation to test display regressions etc ...

To stay simple, Gulp will help you save tremendous amounts of time by handling recurring and automated tasks. You can then focus on your real work : produce clear and concise code, and get a coffee from time to time ! If you want to install Gulp globally on your machine, meaning that you will have access to its commands everywhere, follow the following steps. Otherwise jump to the next section.
As soon as node and npm are installed, you can start instaling Gulp. In your terminal window, enter the following command :
npm install gulp -g
! If you are working in a Linux or a Mac OSX environment, you will probably need to add the sudo command to have the required rights
sudo npm install gulp -g
Gulp should now be installed and ready to serve.
To work properly, it relies on 2 files that you can find at the root of the project :

package.json
gulpfile.js

The package.json file lists all your project's developement and production dependencies installed via npm, an effective way to manage your project's assets consistently. The gulpfile.js file contains all the task that Gulp will perform once launched.
Installing Bulkit
Before we dive more in the Bulkit template, you need to learn how to install it and go through a little setup to make it functional and running. Create a new directory for your project. For the sake of the example, we will call it my-project. Unzip the contents of bulkit-template-4.1.0/bulkit-4.1.0/ inside it. We will talk about the project structure in the upcoming section :
cd path/to/my/project
Once done, you need to install the project dependencies with npm, that we previously installed. Enter the following command at the root of the my-project folder :
npm install
This will automatically fecth all the dependencies listed in your package.json file.  This will also install them in your project (in a newly created directory named node_modules). Once the installation process is done, you are ready to start Gulp and begin developing. However, before you start we are going to take a closer look to the template structure, and to how things are organized.
Template structure
This section is about the Bulkit File structure. Learning more about it will help setup the template quickly and easily.
Global structure
Bulkit
|-- src
|     |-- assets
|     |      |-- font
|     |      |-- img
|     |      |-- js
|     |      |-- sass
|     |      |-- scss
|     |      |     |-- abstracts
|     |      |     |-- base
|     |      |     |-- components
|     |      |     |-- layout
|     |      |     |-- pages
|     |      |     |-- core.scss
|     |      |
|     |      |-- vendor
|     |
|     |-- data
|     |-- layouts
|     |-- pages
|     |-- partials
|
|-- gulpfile.js
|-- package.json
|-- package-lock.json
The directory structure can seem unusual for someone who is not used to build tools. We will break each part of it, so you understand how everything works.
Assets folder
|-- src
|     |-- assets
|     |      |-- font
|     |      |-- img
|     |      |-- js
|     |      |-- sass
|     |      |-- scss
|     |      |     |-- abstracts
|     |      |     |-- base
|     |      |     |-- components
|     |      |     |-- layout
|     |      |     |-- pages
|     |      |     |-- demo.scss
|     |      |     |-- main.scss
|     |      |     |
|     |      |-- vendor
The main reason we are working with npm and gulp is that we want to keep our development process clean, as well as our dependencies management. This kind of setup highly increases the project's code maintainability and scalability. However, you'll be sometimes in a situation where you could need assets that are not served via npm or any package manager. That is the role of the vendor folder. You can add to it any external css, js, fonts or data that you will need to use in your project. However, always prefer the npm method when adding new assets. Use the assets folder only if you can't fetch your required dependency with npm.
Bulma folder
|-- sass
|     |-- sass
|     |-- bulma.sass
When you installed the project by doing npm install, you also installed Bulma 0.9.1 as a project dependency. All bulma framework Sass source files are there. You can customize them to fit your needs or leave them as they are. If you do so, you will get the standard Bulma version (identical to the css file you can find in the bulma distibution folder in the official repo) when you build the project. We provided this option as numerous developers want to have control on this for code optimization purposes.
! Edit the Bulma source files only if you know what you are doing as any faulty customization may completely break the layout.
Layouts folder
|-- src
|     |-- layouts
All the html layouts resides in this folder. For a more concise code, Bulkit uses a flat file compiler named Panini, by Zurb. Panini makes it easy to break your layouts into several reusable components, preventing you to go through every page to make your changes. You can find more information about zurb/panini by visiting the official repository. Bulkit follows the panini pattern for the html file structure.
the layouts folder holds all the template layouts. It is mandatory to have at least one layout, and it should always be named default.html. Additional layouts can have the names you want, but don't forget the .html extension. A layout acts as container providing the same base for a set of similar pages.
Pages folder
|-- src
|     |-- pages
The pages folder holds all the template pages. Pages are focused on content. They are related to a layout and automatically appended to it by panini when the page is served. You will always find the same statement at the top of each page's code :
---
layout: default
title: This is the page title
---
The layout statement tells panini wich layout to use to serve the page. The title element is a string that gets inserted as the page title when panini has finished assembling the page parts together. Now that we had a look to panini's basic features let's dive into the Bulkit html files :
Component pages
Bulkit features 45 component pages wich feature numerous UI elements and variations. These pages reside inside the Demo-Kit. These pages are named following this naming convention: _components_*category_*component.html . Each category features different components and variations. You'll find detailed explanations and code examples that you can immediatly copy to start developping. The following categories are available :

Layout 

Features building blocks that are relevant to layout such as Grid system, Navbars, Video background, Headers, Footers, Typography and Colors.

Sections 

Features premade sections that you can copy and paste in your project pages, with little or no customization needed. Available sections are: Features sections, Pricing sections, Team sections, Testimonials sections, Client grids, Animated counters and Carousel sections.

Basic UI 

Features premade first level components that you can easily reuse such as: Cards, Buttons, Dropdowns, Lists, Modals, Tabs & pills, Accordions, Badges & labels and Popups.

Advanced UI 

Features premade first level components that you can easily reuse such as: Tables, Timeline, Boxes, Lists, and Messages.

Forms 

Features premade inputs and form controls to help you build any kind of form including: Inputs, Controls, Form layouts, and File uploader.

Icons 

Each page in this section lists the different icon collections Bulkit features, with their embed code. Available sets are Icons Mind, Font Awesome, Simple line Icons and Material Icons.
Partials folder
|-- src
|     |-- partials
The partials folder holds all your html partials. Partials are chunks of code that you want to reuse as is accrosse your application : it can be a button, a navbar, a content section or whatever you want. Note that you can create as many subfolders as you want to organize your partials. You simply have to make sure that your partial names are unique. Partials are named like html files : navbar.html. When you want to call a partial in one of your layouts or pages use the following expression : NaN. You don't have to mention the path, even if it is nested in several subfolders, panini will find it. Also note that you don't have to add the html extension in your partial call.
Images
|-- src
|     |-- assets
|     |      |-- img
All the project images live in this folder. It can have as many subfolders as you want. When you build the projects, all these images are automatically transfered to the right location by Gulp. We will see that a bit later.
Js
|-- src
|     |-- assets
|     |      |-- js
|     |      |     |-- auth.js
|     |      |     |-- contact.js
|     |      |     |-- functions.js
|     |      |     |-- index.js
|     |      |     |-- main.js
All of Bulkit own javascript files live in this folder. Edit them to change thee template functionality.
Scss

|-- assets
|     |-- scss
|     |     |-- abstracts
|     |     |      |-- _*.scss
|     |     |
|     |     |-- components
|     |     |      |-- _*.scss
|     |     |
|     |     |-- layout
|     |     |      |-- _*.scss
|     |     |
|     |     |-- pages
|     |     |      |-- _*.scss
|     |     |
|     |     |-- *.scss
Bulkit relies on the powerful Sass features, letting you handle complex styles in a breeze. Bulkit relies on a modular scss structure. You need to import all the SCSS partials into your core file. This how scss files are organized.
Core and partials
There are two main types of Scss files in Bulkit : Core and Partials.
Partial files
Partial files
Partial SCSS file names always start with an underscore like this: _testimonials.scss . They act as chunks of code that you can import only if you need them. Of course some of them are mandatory for the project to work. For example, if you need to display cards in your project, you can import scss/components/_cards.scss to have access to the card components in your layout. We will see later that you need to load them in a specific order to avoid styling issues. SCSS partials are of several types:

Global partials: partials that are common to all demos : _variables.scss. Importing _variables.scss is mandatory.
Theme partials: 10 Themes are built in out of the box in Bulkit. Default is scss/partials/_themes-main.scss . You have to import a theme in your core SCSS file. Otherwise your site will be broken.
Layout partials: Layout partials are all mandatory. You have to import them in order to setup a basic layout for your website.
Component partials: Component partials are optional. However, you will need to add some to your project to hold the content you are planning publish. Bulkit's approach is modular, so you pick only what you use.
Extensions partials: Bulkit is shipped with extensions such as Quickview, Colored checkboxes and many more. Each extension has its own scss partial that you can import if you need some of its features. Sometimes a javascript file is needed for the extension to work.
Pages partials: Page partials are related to content served on Bulkit pages. Each demo kit used to have its own stylesheet, wich is was shared with others. For example, the Startup kit had its own partial named _startup.scss. You could find it in scss/page/_startup.scss. This is over in Bulkit 4.1. The files in there have changed name and role. They now are a collection of reusable elements that you can use in any page or any kit.

Core files
The core SCSS file is the heart of Bulkit's styles. Its main purpose is to centralize all styles. Every time you make a change in a partial file, it impacts the outputed core.css (or any other theme like azur.scss) file resulting from the compilation process. Core files start with imports of other partial SCSS files. Here is an example import statement:
/*! core.scss | Bulkit | CSS Ninja */

/* ==========================================================================
Core Theme
========================================================================== */

/***
TABLE OF CONTENTS
=============================================================================
0. CSS Imports
=============================================================================
***/

/* ==========================================================================
0. CSS Imports
========================================================================== */

