! Notice how partials are imported. Whereas the actual partial file name starts with an underscore and ends with a .scss extension, when you write imports inside your core.scss file, you have to remove the undescore and the .scss extension.
Imports
Let's break a bit the list of imports we saw above, so we can understand how the global stylesheet is structured and how it impacts the final outputed style.

The first line imports scss/abstracts/_variables.scss. Importing this file is mandatory since it contains all core color variables. Without it, nothing will work and your pages will be broken.
The second line is also part of mandatory imports. It imports the selected theme from abstracts/_themes-main.scss.  Each one of these theme files is used by one specific stylesheet. Each theme can be linked to one or several core files. For more consistency, we linked each theme to a single core file (beside the exception that we mentionned above). You can learn more about themes in the Theming section.
The following lines import layout partials from layout/_*.scss. All of these imports are mandatory for the theme to work, as they handle all animations, navbars, sections, footer and even the preloader.
4.The components imports are up to you. However some of them like components/_forms.scss should normally be imported by everyone because... everybody needs forms on a website. But it is still up to you to decide wich components you will need or not in your project. The component imports are followed by extensions imports, if you need to use some special features.
Before closing the imports, it's time to get your page specific partials. In the above example, we can see that the core imports pages/_hero-elements.scss, wich holds finition styles for all hero sections accross the template.
At the very end, import the layout/_helpers.scss and the layout/_responsive.scss. Even if these partials belong to the layout group, they are imported at the end because they are meant to override previously defined styles. See the list of Helpers classes available for more details. The file _responsive.scss holds the global media queries that are common to all demos and applied at the theme scope.

Link the core
Once you finished writing your imports, and adding the basic css resets you want in your core file, you are ready to setup a new page. As we stated before, as soon as Gulp is running, your core file is immediatly outputed into a compiled css file. The css chunks from partials are appended one after another following the order defined in the imports. To import the core, just add a stylesheet link to the compiled css inside the head tags of one of your layout files, like src/layouts/default.html:


! Notice the `` elements wich tells panini to get back to the root of the project to find the css stylesheet.
Root files
There also a few files sitting at the root of the project that we need to discuss before getting into serious business:

gulpfile.js : Gulp will use this file to perform all the tasks it is supposed to accomplish.
package.json : Lists all your project's dependencies and gives useful metadata.
package-lock.json : Automatically generated for any operations where npm modifies either the node_modules tree, or package.json. It describes the exact tree that was generated, such that subsequent installs are able to generate identical trees, regardless of intermediate dependency updates.

Working with Gulp
In this section, we are briefly going to see how to use gulp and the Bulkit gulpfile.js.
Available modules
Bulkit takes advantage of several gulp modules. We are going to see what each one does to give you a better understanding of what is happening. Let's see the modules used by our gulpfile :
const {src, dest, watch, series, parallel } = require('gulp');
const log = require('fancy-log');
const colors = require('ansi-colors');
const browserSync = require('browser-sync').create();
const sass = require('gulp-sass');
const bourbon = require('node-bourbon').includePaths;
const rename = require('gulp-rename');
const concat = require('gulp-concat');
const del = require('del');
const panini = require('panini');
const uglify = require('gulp-uglify-es').default;
const sourcemaps = require('gulp-sourcemaps');
const imagemin = require('gulp-imagemin');
const removeCode = require('gulp-remove-code');
const removeLog = require('gulp-remove-logging');
const prettyHtml = require('gulp-pretty-html');
const sassLint = require('gulp-sass-lint');
const htmllint = require('gulp-htmllint');
const jshint = require('gulp-jshint');
const htmlreplace = require('gulp-html-replace');
const newer = require('gulp-newer');
const autoprefixer = require('gulp-autoprefixer');
const accessibility = require('gulp-accessibility');
const babel = require('gulp-babel');
const nodepath = 'node_modules/';
const assetspath = 'assets/';

