Additional variables
There are two additional variables that we define at the top of the file. We will need them to continue :

assetspath : a shortcut to get stuff from the /assets folder, so we don't expose our internal paths.
nodepath : a shortcut to get stuff from the /node-modules folder (created by npm), so we don't expose our internal paths.

Gulp tasks
We prepared a certain number of predefined tasks that will help you during all the development process. We will go through the gulpfile.js file to detail each one of this tasks.
Server task
function browserSyncInit(done) {
  browserSync.init({
    server: './dist'
  });
  return done();
}

Gulp uses this task to create a browser-sync instance. It creates a local developement server and automatically opens a browser window showing index.html.
Watch task
function watchFiles() {
  watch('src/**/*.html', compileHTML);
  watch(['src/assets/scss/**/*', 'src/assets/scss/*'] , compileSCSS);
  watch('src/assets/js/*.js', compileJS);
  watch('src/assets/img/**/*', copyImages);
}

Gulp uses this task to watch any change you make to the html and Sass files. When it detects changes, it triggers other tasks that handle Sass and html compilation.
Clean task
function cleanDist(done) {
  del.sync('dist');
  return done();
}

Gulp uses this task to clean the dist folder, wich the result of the project build. At the moment you should not see any dist folder because you didn't build the project yet. This task is also used at the beginnning of the build process, to clean the folder before compilign the assets again.
Bulma task
function setupBulma() {
  return src([nodepath + 'bulma/*.sass', nodepath + 'bulma/**/*.sass'])
    .pipe(dest('src/assets/sass/'));
}

gulp uses this task to copy the Bulma source file from their location in the _node-modules folder to the sass/ folder. As these assets are already copied in the project, you shouldn't need this task right now.
Plugins task
function concatPlugins() {
  return src([
    nodepath + 'jquery/dist/jquery.min.js',
    nodepath + 'feather-icons/dist/feather.min.js',
    nodepath + 'typed.js/lib/typed.min.js',
    nodepath + 'easy-autocomplete/dist/jquery.easy-autocomplete.min.js',
    nodepath + 'alertifyjs/build/alertify.min.js',
    nodepath + 'scrollreveal/dist/scrollreveal.min.js',
    nodepath + 'ocanvas/build/dist/latest/ocanvas.min.js',
    nodepath + 'slick-carousel/slick/slick.min.js',
    nodepath + 'croppie/croppie.min.js',
    nodepath + '@fengyuanchen/datepicker/dist/datepicker.min.js',
    nodepath + 'chosen-js/chosen.jquery.min.js',
    nodepath + 'izitoast/dist/js/iziToast.min.js',
    nodepath + 'webui-popover/dist/jquery.webui-popover.min.js',
    nodepath + 'zoom-vanilla.js/dist/zoom-vanilla.min.js',
    nodepath + 'scrollreveal/dist/scrollreveal.min.js',
    nodepath + 'card/dist/jquery.card.js',
    'src/assets/vendor/js/*',
  ])
    .pipe(sourcemaps.init())
    .pipe(concat('app.js'))
    .pipe(sourcemaps.write('./'))
    .pipe(dest('dist/assets/js'))
    .pipe(browserSync.stream());
}

Gulp uses this task to concatenate all the required plugins into a single file which gets pushed to dist/assets/js/ folder. You can then access those plugins from there in your web pages.
Assets tasks
function copyImages() {
  return src('src/assets/img/**/*.+(png|jpg|jpeg|gif|svg)')
    .pipe(newer('dist/assets/img/'))
    .pipe(imagemin())
    .pipe(dest('dist/assets/img/'))
    .pipe(browserSync.stream());
}

function copyFont() {
  return src([
      'src/assets/font/*',
    ])
    .pipe(dest('dist/assets/fonts'))
    .pipe(browserSync.stream());
}

function copyData() {
  return src([
    'src/data/**/*',
  ])
    .pipe(dest('dist/assets/data'))
    .pipe(browserSync.stream());
}

function jsVendor() {
  return src([
      'src/assets/vendor/js/*',
    ])
    .pipe(dest('dist/assets/vendor/js'))
    .pipe(browserSync.stream());
}

function cssVendor() {
  return src([
      'src/assets/vendor/css/*',

    ])
    .pipe(dest('dist/assets/vendor/css'))
    .pipe(browserSync.stream());
}

gulp uses those tasks to copy all external assets and dependencies into the corresponding subfolder of the dist/assets/ folder of the production site.
Compile Sass task
function compileSASS() {
  return src(['src/assets/sass/bulma.sass'])
    .pipe(sass({
      outputStyle: 'compressed',
      sourceComments: 'map',
      sourceMap: 'sass',
      includePaths: bourbon
    }).on('error', sass.logError))
    .pipe(autoprefixer('last 2 versions'))
    .pipe(dest('dist/assets/css'))
    .pipe(browserSync.stream());
}

Gulp uses this task to compile the bulma source files into a single css file. it then copies this file in dist/assets/css/.
Compile Scss task
function compileSCSS() {
  return src(['src/assets/scss/main.scss', 'src/assets/scss/demo.scss'])
    .pipe(sass({
      outputStyle: 'compressed',
      sourceComments: 'map',
      sourceMap: 'scss',
      includePaths: bourbon
    }).on('error', sass.logError))
    .pipe(autoprefixer('last 2 versions'))
    .pipe(dest('dist/assets/css'))
    .pipe(browserSync.stream());
}

Gulp uses this task to compile the Bulkit Scss source files into a single css file (main.css). it then copies this file in dist/assets/css/.
Compile Html task
function compileHTML() {
  panini.refresh();
  return src('src/pages/**/*.html')
    .pipe(panini({
      root: 'src/pages/',
      layouts: 'src/layouts/',
          /*pageLayouts: {
            //All pages inside src/pages/blog will use the blog.html layout
            'blog': 'blog'
          }*/
      partials: 'src/partials/',
      helpers: 'src/helpers/',
      data: 'src/data/'
    }))
    .pipe(dest('dist'))
    .pipe(browserSync.stream());
}

Gulp uses this task to compile all the changes you make to the template html files. It the triggers a refresh from Panini to update your templates before rendering.
Compile js task
function compileJS() {
  return src([
      'src/assets/js/_data-wishlist.js',
      'src/assets/js/_data-addresses.js',
      'src/assets/js/_data-orders.js',
      'src/assets/js/functions.js',
      'src/assets/js/Bulkit.js',
      'src/assets/js/authentication.js',
      'src/assets/js/cart.js',
      'src/assets/js/account.js',
      'src/assets/js/wishlist.js',
      'src/assets/js/product.js',
      'src/assets/js/orders.js',
      'src/assets/js/order.js',
      'src/assets/js/checkout.js',
      'src/assets/js/search.js',
      'src/assets/js/demo.js',
      'src/assets/js/elements.js',
    ])
    .pipe(babel())
    .pipe(dest('dist/assets/js/'))
    .pipe(browserSync.stream());
}

Gulp uses this task to copy all your custom javascript to the distribution folder.
Gulp commands
Now that we have seen that we have a lot of ready to use tasks for gulp. While you can run some of the above tasks individually, let's now see the available commands that make use of multiple tasks at once.
gulp dev
Builds the project and runs a dev server. It runs several tasks that we defined above. Run it by typing this command in your terminal window, at the root of the project :
gulp dev
Here is what happens when you run gulp dev :

Gulp deletes the dist folder
Then, gulp executes all assets copying and compilation tasks :

series(cleanDist, copyFont, copyData, jsVendor, cssVendor, copyImages, compileHTML, concatPlugins, concatCssPlugins, compileJS, resetPages, prettyHTML, compileSASS, compileSCSS, browserSyncInit, watchFiles);

Setup Bulkit
You should now have a basic understanding of what Gulp and Panini are doing. You are now ready to setup the project to start developing. We've been talking about gulp and panini for ages but you'll quickly see how fast it is to setup your project. In your terminal window, change directory to the root of the kit of your choice :
cd path/to/Bulkit/
Then start  by building the project. Run the following command. It will also launch a development server in your browser window :
gulp dev
When the task starts, you should be redirected to your browser showing the index.html page. That's it, your project is now running. Every change you make to the html or scss files will trigger a code compilation and a browser refresh. Really easy isn't it ?
Bulkit Plugins
As stated before, Bulkit's is based on a css only framework, Bulma.io. CSS only means there is no javascript shipped with it, unlike Bootstrap. Bulkit has its own javascript implementation of Bulma components using jQuery. You are free to use the existing implementations or to write your own if you want to. You could also use Bulkit in a Vue js project by using only the css and inspiring from jQuery to write Vue js methods. The choice is up to you. Bulkit has 3 main categories of javascript files :

Core libraries
Plugins
Theme javascript

jQuery
Bulkit relies on 1 core library : jQuery. 99% of the available plugins are served using npm.
Plugins
Bulkit ships with many interesting javascript plugins that increase the frontend experience. If you want more details about plugin usage and initialization, please head to the js reference section. Here is a list of the plugins used by Bulkit.

Innostudio file uploader

A premium jQuery plugin developed by Innostudio. Bulkit grants you a license to use this plugin in one of your projects. It lets you setup a beautiful file uploader for your projects. Read the plugin documentation for more details about usage.

Chosen js

A plugin that transforms native html select boxes into beautiful and customizable select boxes with additional features. Read the plugin documentation for more details about usage.

Counterup

A plugin that makes easy to create animated counters. Notice that it relies on Waypoints, another javascript plugin that triggers events based on scroll position. Read the plugin documentation for more details about usage.

Covervid

Bulkit uses this plugin to display full height background videos. Read the plugin documentation for more details about usage.

Datedropper

Datedropper is a jQuery timepicker plugin. It stands out by it's awesome design and features. Read the plugin documentation for more details about usage.

Datepicker 

jQuery Datepicker is a jQuery timepicker plugin. It has basic features and is a good choice if you are looking for a simple datepicker for your website. Read the plugin documentation for more details about usage.

easyAutocomplete  

A jQuery plugin that lets you easily setup an autocomplete input. You can also create custom templates for your autocomplete fields. Read the plugin documentation for more details about usage.

Datepicker 

jQuery Datepicker is a jQuery timepicker plugin. It has basic features and is a good choice if you are looking for a simple datepicker for your website. Read the plugin documentation for more details about usage.

Embed

Embed is a small jQuery plugin that lets you embed a Youtube or a Vimeo video inside your page. Nothing to configure, you just have to add the video url.

GGtooltip 

A small plugin that helps you to display simple tooltips. Documentation can be found here.

GGpopover   

A small plugin that helps you to display nice popovers with many configuration options. Read the plugin documentation for more details about usage.

gmapjs   

A small plugin that lets you display a google map on your web page. Documentation can be found here.

iziToast   

A nice jQuery plugin to display styled toast notifications on your website. It has many configuration options. Read the plugin documentation for more details about usage.

jqdropdown   

A flexible and easy to use dropdown jQuery plugin. Read the plugin documentation for more details about usage.

scrollreveal

A must have plugin if you want elements to animate on when visible on scroll. Read the plugin documentation for more details about usage.

scrollspy

Everybody knows Scrollspy from Bootstrap. This plugin has the same behaviour. Documentation can be found here. 

slick carousel

A powerful and highly customizable carousel with a very rich documentation. Read more about it here. 

tagsinput

A simple component to transform a text input into a styled tags input.  Read more about it here. 

timedropper

An original timepicker that can be customized. Read the plugin documentation for more details about usage. 

Vivusjs

Vivus is a svg animation library. It makes animating svg paths really easy. Read the plugin documentation for more details about usage.

Waypoints

Waypoints is a famous jQuery and vanilla js library that let's you setup events that trigger at  certain scroll position. The sticky plugin is also really useful to fix elements on scroll.  Read the plugin documentation for more details about usage.

Wallop slider

Wallop slider is an original and powerful slider. Beside being lightweight, it is highly customizable. Read more about it here.

Wickedpicker

A lightweight library that offers a nice timepicker to replace the boring html native one. Read more about it here. 
Theme javascript
Bulkit comes with it's own javascript files.
Global js
We made some big changes here. As if now, main.js and functions.js are bulkit's main javascript files. They are used by almost every page that Bulkit features. main.js holds all plugin initialization but also custom component implementation. However, you should review it carefully before using it in production. Delete the parts that you don't need and customize it to fit your needs. functions.js is a big function library where you will find all the functions used by Bulkit.
Theming
Bulkit is built in a css modular approach. We've made it easy for you to customize theme colors. In this section, we are going to setup a project from scratch to help you get started.
Creating a Theme
Let's start from scratch to make you understand how you can do theming with bulkit.
Add a new Theme
! If your gulp  watcher is still running in your terminal, we recommend you to stop it (Ctrl + C) before creating a new theme.
Create a new file in /src/assets/scss/abstracts/. For the sake of the example, we will name this file _themes-example.scss . Notice the underscore at the start of the file name. Don't forget it or your project will break.
Theme colors
Each Bulkit theme uses the same color variables that you can customize to control colors accross the template. There are 3 main variables :

Primary color
Secondary color
accent color

Our new example theme will use primary red (#f95c64), secondary blue (#325bff) and accent purple (#dc2dff) as its main colors (these colors are just an example, do not use in production and pick your own colors instead). Lets create those new variables. Add this to your src/assets/_themes-example.scss file :
/*! _themes-example.scss | My project | My name */

/* ==========================================================================
Example theme variables and styles
========================================================================== */

//Theme color variables
$primary: #f95c64;
$secondary: #325bff;
$accent: #dc2dff;

Every Bulkit component and layout element rely on these variables. Changing them will immediatly impact all colors on your project. 
Theme gradient
Every theme comes with a linear gradient based on primary and secondary colors (you can change that if you want, but defining the gradient is mandatory).  Add this to your scss/abstracts/_themes-example.scss file :
//Hero gradient
$webkit-hero-gradient: -webkit-linear-gradient(to right, $accent, $secondary);
$hero-gradient: linear-gradient(to right, $accent, $secondary);

Theme shadows
Bulkit plays alot with colored box shadows. Box shadows inherit their colors from the 3 main variables:



Variable
Hex
Rgb




$primary
#f95c64
rgb(249, 92, 100)


$secondary
#325bff
rgb(50, 91, 255)


$accent
#dc2dff
rgb(220, 45, 255)



Now that we have our converted values, we can setup box shadows using the rgba format, wich adds the alpha channel for transparency. If you are using Scss you can simply put the variable name instead. Shadow variables now live in their own file, in assets/scss/abstracts/_shadows.scss.
//Primary box shadow
$primary-shadow-from: rgba($primary, 0.42);
$primary-shadow-to: rgba($primary, 0.2);
$primary-box-shadow:  0 14px 26px -12px $primary-shadow-from, 0 4px 23px 0px $base-shadow, 0 8px 10px -5px $primary-shadow-to !important;

//Secondary box shadow
$secondary-shadow-from: rgba($secondary, 0.42);
$secondary-shadow-to: rgba($secondary, 0.2);
$secondary-box-shadow:  0 14px 26px -12px $secondary-shadow-from, 0 4px 23px 0px $base-shadow, 0 8px 10px -5px $secondary-shadow-to !important;

//Accent box shadow
$accent-shadow-from: rgba($accent, 0.42);
$accent-shadow-to: rgba($accent, 0.2);
$accent-box-shadow:  0 14px 26px -12px $accent-shadow-from, 0 4px 23px 0px $base-shadow, 0 8px 10px -5px $accent-shadow-to !important;

Theme pageloader
Every theme customizes the default backgound color for the pageloader but it's not mandatory. You are free to do so only if you want to.
//Pageloader background color
.pageloader {
    background: $primary !important;
}

Activating a Theme
You're almost ready to start using your new theme but first, we need to wire it to the core scss file. You can create a new core file or edit the exitsing one. in this example, we will create a new theme based off the _themes-main.scss file that lives in the assets/scss/abstracts/ folder.
Start by creating a file named _themes-example.scss in the same folder and copy the contents of  _themes-main.scss in it.
Open  core.scss with your favorite text editor and edit the theme import original statement
@import 'themes-main';

Change it to
@import 'themes-example';

Now start the Sass watcher with gulp:
gulp dev
Congratulations, your demo is setup with a brand new theme you just created. You are now ready to start customizing the template. Now that you have a global understanding of how Bulkit works, you can use the Css and Js reference sections of this documentation to get a grasp on Bulkit classes, classes modifiers and javascript options.
